import React from 'react';
import classes from '../css/Header.module.css';
import Drevo from '../assets';

const Header = () => {
    return (
        <header className={classes.header}>
            <img src='./img/drevo.png' alt='' />
            <div></div>
        </header>
    );
}

export default Header;
